import React from "react";
import "../css/videojuego.css";

function Videojuego() {
    return (
        <div className="contenedor-videojuego">
                <div className="row">
                    <div className="col-8">
                        <div className="row-informacion">
                            <div className="col">
                            <figure class="figure">
                                <img src="../imagenes/vj2.png" class="figure-img img-fluid rounded" alt="..." />
                                <h1 className="display-5">Nombre VDJ</h1>
                                <figcaption class="figure-caption">A caption for the above image.</figcaption>
                            </figure>
                            </div>
                            <div className="col">
                                
                            </div>
                        </div>
                    </div>
                    <div className="col-4">

                    </div>
                </div>
        </div>
    );
} 

export default Videojuego;
